import SettingsIcon from '@material-ui/icons/Settings';

export const Locals = {
  es:{
      title:"Gestion de las coopropiedades en pocos clic's",
      titleCoownerShip:"Tus Coopropiedades",
      menus:{
        m1:[{key:'1', label:'Inicio', icon:SettingsIcon}],
        m2:[
          {key:'1', label:'Residentes', icon:SettingsIcon}, 
          {key:'2', label:'Colaboradores', icon:SettingsIcon},
          {key:'3', label:'Cobros', icon:SettingsIcon},
